import React from "react";
import Card from "./card/card";
import "./cards.css";

const Cards = ({ data: {results} }) => {
    // const personageList = data.results;
    // console.log(personageList);
    return (
        <div>
            {Array.isArray(results) ?
                results.map((element, index) => {
                  return <Card card={element} key={Math.random()*10+index+"thead"}></Card>
              }) :null
            }
        </div>

    )

}
export default Cards;
